import Group from '../assets/imgs/Group 91.png';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import '../assets/css/Future.css';

function Future() {

    return (
        <>
            <div className='contain-bg' >
                <Container fluid="md" >

                    <Row className='rrrow-1'>
                        <Col><h1>The Future of Web3 NoCode</h1></Col>
                    </Row>



                    <Row className='rrrow-1'>
                        <Col><p>Web3Makr allows you to incorporate top ranked blockchain platforms into your work through the drag and drop feature.</p></Col>
                    </Row>


                    <Row>
                        <Col sm={4}>
                            <Col><h1>Multi Chain Deshboard tool</h1></Col>
                        </Col>
                        <Col sm={8}>
                            <img src={Group} alt='kd' />
                        </Col>
                    </Row>

                </Container>
            </div >
        </>
    );
}

export default Future;
